function initializeAll()% Initializes LabJack, all scripts and all global variables.global speed;global TLAseq;global TLCseq;global readyEW;global readyNS;global blink;blink = 0; % blink falsereadyEW = 0; % Initialize global button states.readyNS = 0;TLAseq = 0; % Initialize turn lane states.TLCseq = 0;speed = 1; % Set Speed to 1X.initializeLJ(); % Initialize LabJackgtreset(); % Initialize global timerend